import React from 'react';

const Card = ({ name, id, motto, email, phone }) => {
    return (
        <div className='w-40 pa2 bg-red mh5'>
          <img alt='hbcUsers' src={`https://robohash.org/${id}?200x200`}/>
          <div>
            <h2>{name}</h2>
            <p>{email}</p>
            <p>{motto}</p>
          </div>
        </div>
    )
}

export default Card;
